module.exports = JSON.parse('[{"id":1,"title":"Tour Planning","imageSrc":"/images/Clipart/1.png","description":"Tour planning involves the process of organizing and preparing for a trip or journey to a specific destination. Whether you\'re planning a vacation, business trip, or any other type of excursion, careful planning can make your travel experience more enjoyable."},{"id":2,"title":"Daily Call Reports","imageSrc":"/images/Clipart/5.png","description":"Daily Call Reports are documents or records used by salespeople, customer support representatives, or professionals who engage in regular phone conversations with clients, prospects, or colleagues. These reports help individuals and organizations keep tracks."},{"id":3,"title":"Expenses Management","imageSrc":"/images/Clipart/3.png","description":"Expense reporting and management is a crucial aspect of personal finance, business, and organizational operations. Effective expense management helps individuals and businesses monitor spending, control costs, and make informed financial decisions."},{"id":4,"title":"Secondary Sales","imageSrc":"/images/Clipart/4.png","description":"Secondary sales, also known as downstream sales, refer to the resale of products by retailers, wholesalers, or other intermediaries to end customers or consumers. These sales occur after the initial sale from the manufacturer to the distributor."},{"id":5,"title":"Marketing Campaigns","imageSrc":"/images/Clipart/2.png","description":"Campaigns are organized and purposeful efforts, often marketing or political in nature, aimed at achieving specific goals or objectives. Campaigns are typically designed to promote a product, service, idea, or cause and involve a series of coordinated actions and strategies."},{"id":6,"title":"HRMS Appraisals","imageSrc":"/images/Clipart/6.png","description":"HRMS (Human Resource Management System) is a software application centralizing and automating HR functions. It includes leave management and performance appraisals, streamlining processes for efficient workforce management and fostering  productivity."},{"id":7,"title":"Product Promotions","imageSrc":"/images/Clipart/7.png","description":"Product and promotions are vital components of a marketing strategy, working together to raise awareness. A product fulfills customer needs, while promotions encompass marketing strategies that create awareness and promote a product or service."},{"id":8,"title":"MIS Reports","imageSrc":"/images/Clipart/8.png","description":"MIS (Management Information System) reports are structured documents or data summaries that provide information and insights to support decision-making within an organization. MIS reports are crucial for monitoring and analyzing various aspects of business."},{"id":9,"title":"Geotagging","imageSrc":"/images/Clipart/9.png","description":"Geotagging adds location data such as latitude and longitude to media like photos, videos, and text, indicating their origin. It\'s common in modern devices, including smartphones which use built-in GPS or other location technologies for precise geotagging."},{"id":10,"title":"API Integrations","imageSrc":"/images/Clipart/10.png","description":"API-based integrations refer to the process of connecting two or more software applications or systems using Application Programming Interfaces - APIs. An API is a set of rules and protocols that allows different software applications to communicate with each other."},{"id":11,"title":"Data Management","imageSrc":"/images/Clipart/11.png","description":"Master Data Management - MDM is a comprehensive method of managing and organizing an organization\'s critical data assets to provide, with data integration, an enhanced point of reference. These data elements are shared across multiple systems."},{"id":12,"title":"Quiz Learning Module","imageSrc":"/images/Clipart/12.png","description":"A quiz learning module involves designing and structuring quizzes to assess and reinforce the knowledge of learners. This module can be used in various educational and training contexts to engage learners, test their understanding, and promote interactive learning."},{"id":13,"title":"Internal Communication","imageSrc":"/images/Clipart/13.png","description":"Internal communication involves sharing information, ideas within an organization, enhancing collaboration and productivity. It engages employees, involving them in decision-making and valuing their input, creating a more effective and cooperative work environment."},{"id":14,"title":"Order Booking System","imageSrc":"/images/Clipart/14.png","description":"Product Order Booking (POB) is the system for recording and managing customer orders, playing a vital role in sales and inventory management. It enables businesses to efficiently track and fulfill orders while maintaining precise sales transaction records."},{"id":15,"title":"E-detailing Strategy","imageSrc":"/images/Clipart/15.png","description":"E-detailing, or electronic detailing, is a digital strategy in pharmaceutical sales and marketing. It uses technology, often through multimedia presentations and interactive platforms, to engage healthcare professionals and provide information about pharmaceutical products."},{"id":16,"title":"Retail Prescription Audit","imageSrc":"/images/Clipart/16.png","description":"Retail chemist prescription audit assesses prescriptions and medication dispensing in retail pharmacy settings. It ensures the safe dispensing of medications, verifying compliance with legal and regulatory standards. This meticulous process safeguards public health."},{"id":17,"title":"Doctor Business","imageSrc":"/images/Clipart/1.png","description":"Doctor business involves medical professionals, MDs, or DOs practicing medicine. Stockist business encompasses the distribution and sale of pharmaceuticals supplies. Both play crucial roles in healthcare, ensuring quality medical services and the availability of products."},{"id":18,"title":"Doctor Alerts","imageSrc":"/images/Clipart/2.png","description":"Doctor Birthday and Anniversary alerts play a crucial role in building relationships with healthcare professionals. By acknowledging and celebrating these special occasions, organizations foster connections contributing to a collaborative professional environment."},{"id":19,"title":"Payroll Integration","imageSrc":"/images/Clipart/3.png","description":"Integrating payroll with Management Reporting (MR) optimizes employee compensation and financial reporting in business settings. This integration enhances efficiency streamlining the handling of financial aspects and contributing to overall organizational effectiveness."},{"id":20,"title":"Informative Dashboard","imageSrc":"/images/Clipart/4.png","description":"An informative dashboard visually conveys key information and metrics. It emphasizes essential metrics, KPIs, and insights, meticulously tailored to align with user goals, ensuring a focused and informed decision-making experience."}]');

